function html_Branch_Change(elem,data,field){
  Erp.SetParam(window,'config',data.RecordID);
  
  Erp.SetParam('html_reportinghead','branch_fid',data.RecordID);
  
  
  Erp.LoadVariable('tbl_configdetails',function(){
  for (var i =0;i<tbl_entitydefinition.length; i++) 
  {
    if(elem[0].id != 'html_'+tbl_entitydefinition[i].entitydefinitioncode)
  Erp.SetFieldValue('html_'+tbl_entitydefinition[i].entitydefinitioncode,'');
  }
  
    if(!Fn.IsEmpty(tbl_configdetails) || tbl_configdetails.length < 0)
    {
      for (var i = 0 ; i< tbl_configdetails.length ; i++)
      {
        
        var entitydef = tbl_entitydefinition.find(e=>e.entitydefinition_pid == tbl_configdetails[i].entity);
      
        if(!Fn.IsEmpty(entitydef))
        {
          Erp.SetFieldValue('html_'+entitydef.entitydefinitioncode,tbl_configdetails[i].entityvalue);
        }
        else 
        {
          Erp.SetFieldValue('html_'+entitydef.entitydefinitioncode,'');
        }
      }
    }
    else
    {
      
    }
                   
  }
                  );
}

Erp.OnLoad.Register(LoadFunction);
function LoadFunction(){

  
  for (var i =0;i<tbl_entitydefinition.length; i++) 
  {
    if(!Fn.IsEmpty(tbl_entitydefinition[i]["udftitle"]))
  Erp.SetLabel('html_'+tbl_entitydefinition[i].entitydefinitioncode,tbl_entitydefinition[i]["udftitle"]);
  }
  
  
}


Erp.OnSaveSuccess.Register(SaveSuccessFunction);
function SaveSuccessFunction(){
  parent.Erp.ShowMessage("Data Saved Successfully...","success");
Erp.CloseWindow();
}


